body:
>For now, "Use system icon theme" should be defaulted to off 

In case you want to handle it, you can do it by changing
>return value(u"Preferences/Advanced/useSystemIconTheme"_qs, true);

to
>return value(u"Preferences/Advanced/useSystemIconTheme"_qs, false);

in preference.cpp

Now I've realized general disadvantage of this solution.  You make GUI classes (at least one currently) to be dependent from "theming support" implementation. This is a step back on our evolutionary path, so I would strongly discourage it.
Ideally it should be something like
```c++
if (role == Qt::ForegroundRole)
    return UIThemeManager::instance()->getColor(textColorIDByState(torrent->state()));
```
